[[questions]]
id = "RN128"
question = "Hur ofta upplever elever i olika skolformer att de får hjälp när skolarbetet känns svårt?"
answer = "Totalt sett är det cirka två tredjedelar av eleverna som upplever att de alltid eller oftast får den hjälpen i skolan. Det är alltså ungefär en tredjedel av eleverna som inte upplever att de oftast får hjälp när de behöver, utan bara ibland, sällan eller aldrig. Omkring en av tio elever upplever att de sällan eller aldrig får hjälp när skolarbetet känns för svårt"
difficulty = "Hard"
category = "Education"
