[[questions]]
id = "RN138"
question = "Vad uppger lärarna om tillgången på specialpedagogisk personal?"
answer = "Det är totalt nästan fyra av tio lärare som upplever att det är dålig tillgång på speciallärare på sina skolor och en lika stor andel som upplever att det är bra tillgång. När det gäller specialpedagoger är det totalt tre av tio som uppger att det är dålig tillgång och nära hälften av lärarna svarar att det är god tillgång"
